// buildingCollection.js

import drawnGeoJSON from './data/drawn_shape.geojson';

const buildingGeoJSON = {
  type: 'FeatureCollection',
  features: [
    // Existing GeoJSON features here
    // ...

    // Add the drawn GeoJSON features
    ...drawnGeoJSON.features,
  ],
};

export default buildingGeoJSON;
